export const publicRoutes = [
    {
        path: "/main",
        Element: <Headerr/>
    },
    {
        path: "/gum",
        Element: <ListHelp />
    },
    {
        path: "/ch",
        Element: <CanHelp />
    },
    {
        path: "/nh",
        Element: <NeedHelp />
    },

    {
        path: "/login",
        Element: <Login />
    },
    {
        path:"/gum/:id",
        Element: <Post/>
    },


    {
        path: "/ch/:id",
        Element: <FullCanHelp />
    },


    {
        path: "/nh/:id",
        Element: <FullNeedHelp />
    },


]
